import { __decorate } from "tslib";
import { Component } from '@angular/core';
let RadiografiiComponent = class RadiografiiComponent {
    constructor(radiografieService, token, sanitizer) {
        this.radiografieService = radiografieService;
        this.token = token;
        this.sanitizer = sanitizer;
    }
    ngOnInit() {
        this.currentUser = this.token.getUser();
        this.radiografieService.getRadiografie(this.currentUser.email).subscribe({
            next: async (response) => {
                this.radiografii = response;
                console.log(this.radiografii);
                this.convertImg();
            },
            error: (error) => {
                alert(error.message);
            }
        });
    }
    convertImg() {
        // for(let radiografie of this.radiografii){
        //   this.images.push(this.sanitizer.bypassSecurityTrustResourceUrl('data:image/jpg;base64,' + radiografie.picByte));
        // }
        this.image = 'data:image/jpg;base64,' + this.radiografii[0].picByte;
        console.log(this.image);
    }
};
